INSERT INTO `products` (`id`, `name`, `description`, `price`, `onspecial`, `active`, `created`, `modified`) VALUES
(65, 'Apple', 'Apples are the the most popular of all fruits and also generally available all year round. Perfect for eating raw as a snack and an ideal for making puddings and desserts.\n', '343.73', 0, 1, '2017-01-23 12:17:33', '2017-01-23 12:17:33'),
(66, 'Avocado', 'Avocados are the only fruit that contain fat (monounsaturated fat). They are best eaten raw, sliced, or added to salads', '176.74', 0, 1, '2017-01-23 12:19:00', '2017-01-23 12:19:00'),
(67, 'Bananas', 'Bananas are rich in potassium, riboflavin, niacin, and dietary fibre. They also have high energy value and are really good for growing children and athletes. They are also excellent for low-salt, low-fat, and cholesterol-free diets. Hundreds of different varieties of banana flourish in the tropics, from sweet yellow pygmy to large fibrous plantains and green bananas, which can only be used for cooking. ', '265.47', 0, 1, '2017-01-23 12:19:00', '2017-01-23 12:19:00'),
(68, 'Blackberry', 'The blackberry has always grown in the wild and is a widespread genus. It also seems to be a native to many parts of the world including Britain, North America, and Africa. Captain John Smith was introduced to the blackberries that were growing in the wilds of America. The blackberry is also a member of the rose family—not a true berry, but a collection of drupelets. The blackberry is a climber. It''s also high in vitamin C.', '461.63', 0, 1, '2017-01-23 12:19:08', '2017-01-23 12:19:08'),
(69, 'Durian', 'Despite the fruit''s disgusting smell, when durians are ripe, the flavour of the flesh is the most delicious of tropical fruits. This fruit is eaten fresh and chilled, scooped out using a spoon and discarding the seeds. The rich, custardy flesh can be eaten just as it is or it can be pureed to make ice cream or milk shakes. The flesh is also used for making jam, cakes, and it is available canned.\r\n', '298.71', 0, 1, '2017-01-23 12:24:09', '2017-01-23 12:24:09'),
(70, 'Figs', 'Figs are oval or pear-shaped and can be eaten fresh or dried. They are well known for their laxative and digestive properties. Their high, natural sugar content makes them the sweetest of all fruits. The flavour varies, depending on where they were grown and how ripe they are.\r\n', '306.06', 0, 1, '2017-01-23 12:25:41', '2017-01-23 12:25:41'),
(71, 'Grapefruit', 'One of the largest citrus fruit, grapefruits are a cross between the pomelo and the shaddock. High in vitamin C, grapefruits are best eaten raw, a traditional breakfast fruit. The best way to eat is to cut them in half and scoop out the flesh with a spoon.\r\n', '103.07', 0, 1, '2017-01-23 12:25:42', '2017-01-23 12:25:42'),
(72, 'Guava', 'These are delicious eaten raw while the whole fruit is edible. An average-sized guava contains about seven times the recommended daily intake of vitamin C. Guava also provides vitamin A and is high in fibre. ', '58.16', 0, 1, '2017-01-23 12:27:56', '2017-01-23 12:27:56'),
(73, 'Grapes', 'Have been used in wine making for thousand of years and red wine is known to help prevent heart disease. They are a great energy source because of their natural fruit sugar content. ', '237.43', 0, 1, '2017-01-23 12:27:57', '2017-01-23 12:27:57'),
(74, 'Kiwifruit', 'Kiwifruits are best eaten uncooked. The easiest way to eat them is to cut the fruit in half and scoop the flesh out of the skin with a spoon. Or you can peel them and cut into cubes or slices. ', '99.49', 0, 1, '2017-01-23 12:28:00', '2017-01-23 12:28:00'),
(75, 'Lemon', 'Rarely eaten on its own, lemons are an indispensable ingredient in the kitchen. Lemon juice can be used instead of vinegar in sauces, for seasoning in vinaigrette and as instant dressing for fish and shellfish. The best way to store lemon is in the vegetable crisper in the fridge you can put lemons in fruit bowl for a shorter, check them often - if one starts to spoil, the rest will quickly follow. ', '54.83', 0, 1, '2017-01-23 12:28:01', '2017-01-23 12:28:01'),
(76, 'Mango', 'Mangoes grow in many tropical climates worldwide, The fruit ranges in colour from green to golden yellow and orange-red, and its flesh is a juicy, deep orange surrounding a large flat inedible stone. Mangoes also make excellent ice creams, sorbets, sauces and drinks like smoothies. ', '451.09', 0, 1, '2017-01-23 12:28:02', '2017-01-23 12:28:02'),
(77, 'oranges', 'Oranges are best eaten in their natural state but can be used in variety of desserts, pastries, fruit salads, mousses, souffles, ice creams and sorbets. It can be squeezed for juice or used to marinate poultry or fish. Oranges fall into two groups: sweet oranges, which can be eaten raw, and bitter oranges, which cannot be eaten raw, but are used for making marmalade, jams, and jellies instead. ', '208.53', 0, 1, '2017-01-23 12:28:03', '2017-01-23 12:28:03'),
(78, 'Passionfruit', 'The most popular variety is the purple passionfruit about the size of a chicken egg. It has a highly fragrant, sweet, but slightly tart, tasting fruit that can be spooned out and eaten fresh or added to fruit salad, pavlova, and it makes a very popular drink, ice cream and sorbets and a flavouring for all kinds of desserts.\r\n', '393.24', 0, 1, '2017-01-23 12:29:00', '2017-01-23 12:29:00'),
(79, 'Peaches', 'The most familiar peaches are round or "beaked" with a pointed, and they are seldom sold by variety but by the color of their flesh—yellow or white. Which you choose is a matter of preference, some people believe that white peaches have the finer flavour. Peaches are delicious eaten on its own or in a fruit salad.\r\n', '197.90', 0, 1, '2017-01-23 12:29:01', '2017-01-23 12:29:01'),
(80, 'Pineapple', 'Derived from the Spanish word ''pina'' meaning pine cone. Pineapples have a juicy, sweet-but sometimes slightly tart-fragrant flavour. They are best eaten fresh, serve pineapple flesh in slices, wedges or chunks. It is also available in cans, dried and glace. A good source of vitamin C.\r\n', '74.91', 0, 1, '2017-01-23 12:29:40', '2017-01-23 12:29:40'),
(81, 'Pomegranates', 'An exotic-looking fruit about the size of a large apple with a thin, tough skin (usually golden to deep red), pomegranates filled with edible seeds contained in a crimson-colored pulp. To use, cut the fruit in half with a very sharp knife and scoop out the tangy sweet seeds, separate them from the white pith and eat them fresh. Can be added to salads, use as a garnish on sweet and savoury dishes or press to extract juice.\r\n', '335.82', 0, 1, '2017-01-23 12:29:41', '2017-01-23 12:29:41'),
(82, 'Pear', 'Pears contain a small amount of vitamin A & C and some potassium and riboflavin. Pears should always be bought when they are in perfect condition as they deteriorate quickly.\r\n', '163.90', 0, 1, '2017-01-23 12:29:43', '2017-01-23 12:29:43'),
